// src/pages/BookBike.jsx
import React, { useState } from 'react';
import BikeCard from '../components/BikeCard';

const bikeData = [
  {
    id: 1,
    model: 'Royal Enfield Classic',
    price: 800,
    imageUrl: 'https://source.unsplash.com/800x600/?enfield,bike',
    location: 'Hyderabad',
  },
  {
    id: 2,
    model: 'Honda Activa',
    price: 400,
    imageUrl: 'https://source.unsplash.com/800x600/?activa,scooter',
    location: 'Chennai',
  },
  {
    id: 3,
    model: 'Yamaha FZ',
    price: 500,
    imageUrl: 'https://source.unsplash.com/800x600/?yamaha,bike',
    location: 'Hyderabad',
  },
];

function BookBike() {
  const [location, setLocation] = useState('');
  const [selectedDate, setSelectedDate] = useState('');

  const filteredBikes = bikeData.filter((bike) =>
    bike.location.toLowerCase().includes(location.toLowerCase())
  );

  return (
    <div className="p-6 bg-gray-100 text-black dark:bg-gray-900 dark:text-white min-h-screen">
      <h2 className="text-2xl font-bold text-blue-600 dark:text-blue-300 mb-2">
        ðŸ“… Book Your Ride
      </h2>

      <p className="text-red-600 font-bold mb-4">
        ðŸš§ BookBike is rendering successfully!
      </p>

      <div className="flex flex-col sm:flex-row gap-4 mb-6">
        <input
          type="text"
          placeholder="Location"
          value={location}
          onChange={(e) => setLocation(e.target.value)}
          className="px-3 py-2 border rounded dark:bg-gray-800 dark:text-white"
        />
        <input
          type="date"
          value={selectedDate}
          onChange={(e) => setSelectedDate(e.target.value)}
          className="px-3 py-2 border rounded dark:bg-gray-800 dark:text-white"
        />
      </div>

      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
        {filteredBikes.map((bike) => (
          <BikeCard key={bike.id} bike={bike} />
        ))}
        {filteredBikes.length === 0 && (
          <p className="text-gray-700 dark:text-gray-300">
            No bikes found for that location.
          </p>
        )}
      </div>
    </div>
  );
}

export default BookBike;
